INSERT INTO `about` (`id`, `text`, `headerimg`) VALUES
(1, '<p>Great &quot;O&quot; Music is your source for newly recorded versions of hit songs in all genres of music. Our catalog contains thousands of masters with excellent sound quality and can provide you with just the right music for any personal or commercial project.<br />\r\n<br />\r\nAdditionally, our catalog continues to grow as we work with a wide variety of licensing partners such as advertisers, television/motion picture productions and product manufacturers.<br />\r\n<br />\r\nSo whether it&#39;s for a performance, movie project or any other commercial use all your favorite music can be found here.<br />\r\n<br />\r\nGreat &quot;O&quot; Music strives to be your home for all of your music needs with our collection of top-quality recordings from Pop, Dance, R&amp;B, Hip-Hop and Rock, to every genre in between.<br />\r\n<br />\r\nSearch our comprehensive music catalog to simplify your licensing needs!</p>', 'about.jpg');
