INSERT INTO `contact` (`id`, `name`, `email`, `reason`, `comments`, `date`) VALUES
(1, 'Nick', 'theonlynickrose@gmail.com', 'Licensing', 'How much to license the Jump Around acappella for a cover version/remix?\r\nThanks', '2015-01-29 17:00:24'),
(2, 'Dmytro Kutsyi', 'djnightstyleexotic@i.ua', 'Questions', 'hello i can use legal your ACAPELLA ESSENTIALS: DJ COLLECTION, VOL. 2 and creat one or more track for later released on beatport ?', '2015-06-03 19:50:49'),
(3, 'PR Angelina Lavo', 'pr@angelinalavo.com', 'Questions', 'Hi,\r\n\r\nDo you have an email were to send demos?\r\n\r\nThank you.', '2016-02-12 19:04:24'),
(4, 'NIGMA', 'nigmadj@hotmail.com', 'Licensing', 'Hello\r\nI\'ve recently bough this \"kung fu fighting\" sample from beatport, from your album with acapella 4 djs. https://pro.beatport.com/release/only-4-djs-acapella-tools-vol-4/1601311\r\nMy question is, is this acapella royalty free and can I use the acapella in a track and release it as original track? I\'m not sampling the vocals into unrecognizability, but I\'m making an upgraded moombah/twerk version of the classic track Kung Fu fighting, using the acapella I\'ve purchased from you. So am I allowed to do that and release it as original track with out getting in trouble, or what options do I have?\r\n\r\nKind regards, NIGMA', '2016-02-25 10:28:53'),
(5, 'Matteo Natali', 'natalimatteo@outlook.it', 'Questions', 'Hi I created a remix with the acapella and instrumental version of Somewhere Over The Rainbow I can put it on Soundcloud as a free download? The two versions I downloaded from Beatport.\r\n\r\nMatteo\r\n\r\n\r\n\r\n', '2016-03-31 18:26:20'),
(6, 'richard', 'richarddj@free.fr', 'Questions', '80 % de rÃ©duction sur l\'Ã©pargne- juillet\r\nPour le mois de Juillet que nous rÃ©duisons le prix de notre enregistrement License Sound ( Monde, 1 an ) de 80%.', '2016-07-12 10:59:23'),
(7, 'THE VEGAS', 'info@thevegasbros.com', 'Licensing', 'Hi Great \"O\" Music,\r\nI\'ve bought  from beatport the acapella of \"Hold the Line (Acapella Version)\" and I\'ve created a remix that you can listen from this private link: https://soundcloud.com/thevegasbros/hold-the-line/s-47CUK .\r\nNow I would like to know how can I release this track with a label that already like it?\r\nThank you for your attention.\r\nBest regards!\r\n\r\nAndrea Zito\r\nArtist / THE VEGAS\r\nwww.thvegasbros.com', '2016-09-01 23:18:32'),
(8, 'THE VEGAS', 'info@thevegasbros.com', 'Licensing', 'Hi Great \"O\" Music,\r\n\r\nI\'ve bought  from Beatport the acapella of \"Hold the Line (Acapella Version)\" and I\'ve created a remix that you can listen from this private link: https://soundcloud.com/thevegasbros/hold-the-line/s-47CUK .\r\nNow I would like to know how can I release this track with a label that already like it?\r\nThank you for your attention.\r\nBest regards!\r\n\r\nAndrea Zito,\r\nArtist / THE VEGAS\r\nwww.thevegasbros.com', '2016-09-01 23:25:03'),
(9, 'Royce Groome', 'roycegroome@gmail.com', 'Licensing', 'Hey, are you able to create custom orders upon request? \r\n\r\nI would like to sample Reel 2 Real - I Like To Move It - only 1 line from the main vocal sample \r\n\"I like to move it move it, i like to move it move, i like to move it move it, you like to move it\" \r\nIs this something that can be licensed? \r\nThanks\r\nRoyce ', '2016-09-05 17:31:29'),
(10, 'Paolo Pellegrino', 'pa.pellegrino@live.it', 'Licensing', 'Hello,\r\nI would be interested to your accapella: \"Last night dj saved my life\"\r\nto make my new track.\r\nI wanted to know, the license that you released me what gives me the right?\r\nA license is immediate?', '2016-11-15 18:47:28'),
(11, 'Stefan Fuchs', '123steff@gmx.at', 'Sample Clearance', 'Hi Together!\r\n\r\nI have a question about a Acapella sample from you.\r\nWhen i buy any Acapella from \"Great o Music\"  , on Beatport, etc..., \r\nCan i use the Acapella in my commercial production for sale, if i have a licence from the creator?\r\n\r\nPlease let me know \r\nThanks\r\nStefan , Steve', '2016-11-29 10:16:53'),
(12, 'Royce Groome', 'roycegroome@gmail.com', 'Sample Clearance', 'Hi Team, are you able to do a vocal replay or sample clearance for these two tracks? \r\nI would simply require the chorus for each track. \r\nO lets do it - by Waka Flocka Flame.\r\nReel 2 Reel - I like to move it\r\nThanks', '2016-12-08 02:55:59'),
(13, 'steve', 'djsteveoparso@yahoo.co.uk', 'Licensing', 'hi what license do I need to use in my productions and release with record label? is this possible?\r\nthanks', '2017-01-06 18:06:21'),
(14, 'Alex Chantzaras', 'alex_chantz@hotmail.com', 'Licensing', 'Greetings, I am a music producer and I want to ask you if I buy this acapella from beatport https://www.beatport.com/track/mr-roboto-acapella-version-original-mix/6671521 can I make a production and do a release from a label without copyright problems for me or my label?', '2017-01-11 22:32:21'),
(15, 'Saad Al-Jadir', 'saad@deckstar.com', 'Questions', 'Good day,\r\nI would like to know the process for processing a sound recording license through your site with the ability to allow third party licensing should the opportunity arise related to the new work?\r\nPlease email me back saad@deckstar.com\r\nBest,\r\nS\r\n', '2017-01-25 03:14:49'),
(16, 'Tim', 'tootim@comcast.net', 'Licensing', 'Hello. If you purchase a tune, in this case on Beatport, and want to use it in a remix, do you need to come back here and license it. The tune is a Acapella version of Lean on Me. It may or may not be sold, but will be on soundcloud and artist website. Thanks for any help...', '2017-01-31 21:39:08'),
(17, 'Daumantas Vinkevicius', 'daumantas@lithuaniahq.com', 'Questions', 'Hey,\r\n\r\nDaumantas from Lithuania HQ Records here. We\'re interested working on development of cover tracks and love your acapellas. Recently one of your cover (ATC - All Around The World) licensed by us just hit 1 million plays on Spotify. We\'d like to know if you are available on working on custom licensing deals, instead of prepay (for example split-shares) for further strategic development.\r\n\r\nCheers,\r\nDaumantas Vinkevicius\r\nhttp://www.youtube.com/LithuaniaHQ', '2017-03-15 16:30:40'),
(18, 'PAULJEY', 'pauljey@hotmail.it', 'Licensing', 'Hi, you are interested in a olivia madelein remix (LAST NIGHT A DJ SAVED MY LIFE) ', '2017-04-12 15:47:51'),
(26, 'Ben Lazarus', 'benlazarus24@gmail.com', 'Questions', 'Hi,\r\n\r\nI am looking at purchasing some of the acapella versions of tracks. I am just wondering how I find out the singer of the track? For example, I am trying to find out who is singing the version of Don\'t Stop Believin\' by Journey.\r\n\r\nThank you\r\nBen', '2017-05-17 23:44:05'),
(32, 'Joshua Loner', 'josh@alienmusic.net', 'Licensing', 'Hi,\r\nI am interested in licensing the \"Disco Inferno Acapella Mix\" but before I submitted a full on licensing request, i wanted to inquire as to how much the PayPal licensing fee would be? \r\nThanks', '2017-08-30 20:12:12'),
(33, 'Seveneves Records', 'contact@seveneves.de', 'Questions', 'Hi, weÂ´re a german label and publish music worldwide. And we have an important question:\r\nYou sell in your dj tools Vocals for djs and producers. We want to publish a song, which includes a vocal from dj tools. \r\nhttps://drive.google.com/file/d/0B8Z4kfgwcEDANE5ZNnFyWG53dW8/view?usp=sharing\r\nBut weÂ´re not sure because the copy right. We think itÂ´s a covering and we have to clear it? \r\nThis is the song with your Smaple: https://drive.google.com/file/d/0B8Z4kfgwcEDANE5ZNnFyWG53dW8/view?usp=sharing\r\nAnd the original is this song; https://www.youtube.com/watch?v=A_sY2rjxq6M\r\nWe would be very happy if we could get a fast answer from you.\r\nThanks, Patrick & Matthias\r\n', '2017-11-12 14:28:08'),
(34, 'Piotr Gryglewicz', 'piotr@djpromotion.com.pl', 'Licensing', 'I want to buy the licence for some acapellas, but I don\'t see the costs. \r\nIn case of audio recording (cover remix) and make the audio oir video clip for YouTube do I need two licences?\r\nso please send me the details.\r\n\r\nRegards\r\n', '2017-12-19 10:09:48'),
(35, 'Angela Burgess', 'angela@ruckus.media', 'Licensing', 'Hi there\r\nI am the Line Producer at Ruckus Media - a TV production company in Auckland, New Zealand.\r\n\r\nWe are currently producing a documentary mini series about the \"Sharp Blacks\" - The NZ Butchery team competing in the World Butchery Challenge in Belfast 2018. The mini series will air on TVNZ On Demand platform (i.e web streaming video); and we are required to license it for 5 years, NZ Only\r\nEach year the Sharp Blacks create their own Music Video for distribution on online platforms i.e you tube, social media. We are filming Behind the scenes footage of them shooting the music video; and will include this BTS footage plus snippets of the final clip in our documentary series.\r\nCan you please advise the cost to us to license U Can\'t Touch This, Instrumental Version Original Mix for web streaming video, 5 years, NZ Only. PLUS the cost to license the same clip for web streaming, 5 years, Wordwide?\r\nThank you for your time. If you wish to contact me my number is +6421626089 or email angela@ruckus.media.\r\nKind ', '2018-01-18 21:34:28'),
(36, 'Daniel', 'mintmastering@outlook.com', 'Questions', 'Hi,\r\n\r\nMy name is Daniel and I\'m an Audio Engineer from Sydney, Australia. I have 6 year\'s experience working with big and small labels, as well as movie studios with feature films currently in cinemas. I have also been a DJ and Producer for the past 10 years. \r\n\r\nAfter working the 9-5 company life for the past few years, I\'ve decided it was time to step out on my own and work independently. While working for myself, I have mastered tracks for different artists and labels including Sony, Central Station, Superstar Recordings, One Love and Safari Music. \r\n\r\nI understand you probably have a bunch of audio engineers you work with already, but I\'m just wanting to reach out, introduce myself and offer my skills to you if needed. I know you require the highest quality mastering for your tracks, and I\'m most certainly capable of providing that for you on an ongoing and consistent basis.\r\n\r\nAs a way to introduce myself and hopefully start a great relationship, I would be grateful for the opportunity to show what I ca', '2018-03-26 04:27:27'),
(37, 'Matej Blanusa', 'djmattej@gmail.com', 'Licensing', 'Hello, I bought Acapella Greats Studio Series Vol. 3. and I want ask, if I make new version Last Night A Dj Saved My life, have I permission for this song? because I want to publish that song... can you explain me?\r\n\r\nThanks. Mathey B\r\nwww.matheyb.com', '2018-04-18 13:31:47'),
(38, 'Rasmus', 'rasmus_aberg@hotmail.com', 'Questions', 'Hello, i just bought an acapella from beatport that you guys made. It is, stand by me(acapella verison). And i made a remix on dat song and i want too use this acapella on it. Soe im just wondering if its okay if i can upload this to soundcloud/Spotify? // Rasmus', '2018-04-25 17:11:20'),
(39, 'Marcin', 'marcin.mackiewicz@poczta.fm', 'Licensing', 'Hello\r\nI have a question:\r\nIf i buy acapella on your site with proper license can I use this in commercial release?\r\nFor example i want to buy ATC style acapella track and want to name it like: ARTIST NAME - TITLE\r\n\r\nGreetings', '2018-05-12 21:01:41'),
(40, 'Philip Sagar', 'phil@armadamusic.com', 'Licensing', 'Hi , I\'m requesting a sound recording license for use of your \'Heard It All Before\' acapella recording.\r\nI can\'t complete by using the form as I require a longer term than 3 years . As it\'s a non exclusive license I need the term to be \'in perpetuity\' please. I also need to know if it\'s a one off fee for usage with no royalties to pay ? The acapella is for commercial use  - on a single from an artist signed to Armada Music. I have full approval from all three publishers of the original master ; Warner/ Chappell Music , Pinky\'s Playhouse and Sunshine Music.  Can you let me know on the email address I\'ve submitted please.\r\nThanks', '2018-06-25 15:38:10'),
(41, 'Patrick', 'leex.music@gmx.de', 'Licensing', 'Hello Guys!\r\nI want to ask you some questions about licensing your acapellas, because the acapellas are really nice!\r\nIf I produce a cover dance song with any of your acapellas, for example \"Stand By Me\", how much does it cost and which licens is the right one to publish that cover song in Spotify, itunes etc..? Sound Recording License ?\r\nThank you for your answer !\r\nBest\r\nPatrick', '2018-07-22 19:26:03'),
(42, 'Roger', 'Rogermthedj@gmail.com', 'Questions', 'When licensing do u guys clear the publishing? The Shaft \"Sway\" track has an acapella included?', '2018-12-06 17:54:32'),
(44, 'Carmelo Rosa', 'office@lemonjuicerecords.com', 'Licensing', 'Hello\r\nwe bought the acapella \"show me love\" on beatport\r\nwe intend to use it on our new track and publish a single release and a video clip\r\nConcerning the license: We need to know the exact, definitive and official procedure regarding the use of the acapella in question\r\nThanks in advance\r\n\r\nLemon Juice Records\r\n', '2019-01-14 05:37:45'),
(45, 'Krystian', 'deejaycrash@wp.pl', 'Licensing', 'Hi, I want to buy sound recording licenses for some songs, that they don\'t to be in your music catalog. Can you help me to get the licenses for those songs? Here is a list of songs:\r\nBoney M - Daddy Cool\r\nAlphaville - Forever Young\r\nEurythmics - Sweet Dreams\r\nToto - Africa\r\nMadonna - La Isla Bonita\r\nCyndi Lauper - Girls Just Want To Have Fun\r\nRick Astley - Never Gonna Give You Up\r\nModern Talking - You\'re My Heart, You\'re My Soul\r\nSurvivor - Eye Of The Tiger\r\nThe Outfield - Your Love\r\nLaura Branigan - Self Control\r\nPhil Collins - Another Day In Paradise\r\n\r\nGreetings \r\nKrystian', '2019-01-30 00:07:42'),
(46, 'Laurynas', 'fwoshofficial@gmail.com', 'Questions', 'Hello. I have a queation. If I buy an acapella from beatport, from your label, when I make a track, I can release it on online shops and etc.? Its royality free or not, when I buy it from beatport?', '2019-02-04 14:32:22'),
(49, 'dennis kolotylo', 'kolotylo39@gmail.com', 'Questions', 'can u delet my account please ', '2019-07-19 17:48:17'),
(50, 'Corentin SAUVAGE', 'info@theta-sound.com', 'Licensing', 'URGENT QUOTE REQUEST\r\nHi there,\r\nWe are a music publisher specialized in music for motion pictures and advertising campaigns.\r\nWould like to use a track in one of our trailer.\r\nCould you please send us your quote (time sensitive) asap for the following use : \r\n\r\nWe are requesting a quotation for the master recording and synchronization rights in the master recordings and musical compositions \"Here Comes the Hotstepper (acapella version) in the trailers for the Picture as follows:\r\n\r\n1.     Rights:  The following perpetual, worldwide rights: the right to fix the masters and compositions in and as part of trailers, promotions and advertising for the Picture and to distribute, exhibit and broadcast the trailers, promotions and advertising in any and all media, now known or hereafter devised, including, but not limited to, theatrical, theatrical exhibitor partners, non-theatrical and television release (whether, in the case of television, by free, basic, pay, subscription television, satellite TV, CATV, closed ci', '2019-07-24 18:42:40'),
(53, 'Tiago Maioli', 'djtiagomaioli@gmail.com', 'Questions', 'Hello how are you?\r\nMy name is Tiago Maioli, Brazilian, I am a simple and passionate producer of House Music.\r\nI\'ve been hearing and buying through Traxsource an acapella you made, \"The Spinners I\'ll be around\".\r\nhttps://www.traxsource.com/track/2728250/ill-be-around-acapella-version\r\nI really liked the result! This song has a very good energy!\r\nCongratulations!!!\r\nI also created a non-commercial remix using it. I would like to show and know what you think:\r\nhttps://soundcloud.com/djtiagomaioli/illbearound/s-RHwxQ\r\nOnce again my congratulations! And I hope you enjoy it!\r\nSee you later!', '2019-09-05 13:58:59'),
(54, 'AveryDiara', 'raphaeJuibia@gmail.com', 'Advertising', 'Hi!  greatomusic.com \r\n \r\nHave you ever heard of sending messages via feedback forms? \r\n \r\nImagine that your message will be readseen by hundreds of thousands of your future customerscustomers. \r\nYour message will not go to the spam folder because people will send the message to themselves. As an example, we have sent you our offer  in the same way. \r\n \r\nWe have a database of more than 30 million sites to which we can send your offer. Sites are sorted by country. Unfortunately, you can only select a country when sending a letter. \r\n \r\nThe cost of one million messages 49 USD. \r\nThere is a discount program when you buy  more than two million letter packages. \r\n \r\n \r\nFree trial mailing of 50,000 messages to any country of your choice. \r\n \r\n \r\nThis message is created automatically. Please use the contact details below to contact us. \r\n \r\n \r\n \r\nContact us. \r\nTelegram - @FeedbackFormEU \r\nSkype  FeedbackForm2019 \r\nEmail - feedbackform@make-success.com', '2019-09-21 10:26:41'),
(55, 'Neil Chin', 'neil_a_chin@yahoo.com', 'Sample Clearance', 'Hello, I just recently purchased your â€œpull up to the bumperâ€ accapella version on Traxsource. I was wondering if this is royalty-free to use in my own music production, or if not, do I need to purchase a license from you to clear it for use? If so can you please advise me on which license I will need? Thank you. ', '2019-10-03 16:03:50'),
(58, 'Adam Shlom', 'shlomada@gmail.com', 'Licensing', 'Hi I purchased the following Acapella from Beatport = Show me love Acapella Greats, Label Great O Music. It\'s item 7880058. Can I use it in a commercially released production? Does purchasing it on Beatport give me licensing? \r\n\r\nThank You,\r\nAdam', '2019-11-03 18:02:16'),
(59, 'Marco Chiavarini', 'markmendymusic@gmail.com', 'Sample Clearance', 'Hey there,\r\nMy name\'s Marco and I\'m a music producer going by the name of Mark Mendy.\r\nI found your Stand By Me (Acapella Mix) on Beatport and purchased it.\r\nMy question is: by purchasing the acapella can I actually use it to make a re-work of Stand By Me and then release it as my own song on all digital stores & streaming platforms?\r\nLooking forward to hearing from you, thanks for your time!\r\nMarco', '2020-02-04 11:35:40'),
(60, 'Stuart Kupinsky', 'stuart.kupinsky@blackboard.com', 'Licensing', 'Hello, I believe your Internal Corporate Presentation License is what I need but would like clarification.  We would like to license the instrumental version of Rapper\'s Delight, record our own compliance training lyrics on top of the music, and send to employees as a fun way to give a corporate compliance training to employees on various topics.  It may not be in sync to images (i.e., just an mp3 file).  Could you let me know the appropriate license and cost?  (The corporate presentation license was listed as $400 for global/3 years, which is fine.)  Thanks, -Stuart', '2020-02-04 20:56:08'),
(78, 'Otto Petersson', 'ottopettersson@hotmail.com', 'Questions', 'Hello!\r\n\r\nIs your â€Cant get you out of my Headâ€ Acapella Kylie Minogues original or is it a cover by another Singer?', '2020-03-15 10:01:14'),
(87, 'Thomas Degn', 'thomas.degn@discowax.com', 'Licensing', 'Hi\r\nI would like to use one of your acappelas for a production, but i need a perpetual license and not just 3 years, is that possible. \r\n', '2020-06-09 09:56:54'),
(91, 'Rickie Cleere', 'r.cleere@circlepoint.com', 'Licensing', 'This is Rickie Cleere reaching out on behalf of the Long Beach Water Department. We would like to request a quote for using an instrumental version of the first 15 seconds of the song \"U Can\'t Touch This\" (instrumental) for our Flush Responsibly Social Media Campaign The track would be looped as part of a gif that would be posted in social media ads for 4 weeks. I wasn\'t sure which license to request for this effort, so any informatino would be greatly appreciated. Thanks!', '2020-06-18 21:58:11'),
(92, 'Sergey Polyakov', 'martdj@mail.ru', 'Sample Clearance', 'Hello I\'d like to clear Finally (Acapella Version) | In the style of CeCe Peniston | Acapella Version\r\nFor my cover version of this song. Please Let me know how to make this thing the right way\r\nhttps://soundcloud.com/mart-official/finally2020-6-spotify Here\'s the track I made for it', '2020-06-22 19:34:06'),
(93, 'Rickie Cleere', 'r.cleere@circlepoint.com', 'Licensing', 'Hello,\r\nI just made a payment for a 3 year web advertising license for \"U can\'t Touch This\" (Instrumental). After paying through Paypal I was directed here to request an invoice/receipt. Are there any next steps? Will I be able to download and use the file?\r\nThanks', '2020-06-24 19:39:21'),
(94, 'Reynor', 'iamreynor@gmail.com', 'Sample Clearance', 'Hey Great O Music,\r\nI have a question. I\'ve made a track with your vocal of Like a Prayer. Now I want to release it as cover of Madonna\'s Like a Prayer on Spotify. Which License do I need for that? \r\n\r\nCheers, Reynor', '2020-06-30 12:36:00'),
(99, 'Jeremy Donaccia', 'jeremydonaccia@hotmail.fr', 'Sample Clearance', 'Dear Sir,\r\n\r\nMy name is Jeremy Donaccia, I am french DJ/Producer\r\n\r\nI use in a track your acapella of What a feeling and I would to do a licensing.\r\n\r\nLet me know how we can do\r\n\r\nThank you for your answer\r\n\r\nBest Regards,\r\n\r\nJeremy Donaccia', '2020-07-15 02:22:01'),
(339, 'Robert Andersson', 'robert.lyceum@live.com', 'Licensing', 'Hello!\r\nI recently bought one of your acapellas on Beatport of Madonnas Into the Groove. (Link: https://www.beatport.com/track/into-the-groove-acapella-tool-original-mix/6971427) \r\nI have used this to make a cover/remake of her tune. I was wondering if I could ask for your permission to upload my tune on my Soundcloud page to share with others. Thanks and Happy New Year! =)', '2021-01-04 18:39:38'),
(360, 'Eoin', 'eoinmorgan704@gmail.com', 'Advertising', 'Hi there,\r\nI own the domain name \"great-music.com\". I was planning on using the great-music.com for a project, but my plans have changed recently. Iâ€™m wondering if you would be interested in acquiring this domain name. Please let me know.\r\nBest Regards,\r\nEoin', '2021-01-27 05:02:36'),
(362, 'Amanda', 'naughtyfairylin@gmail.com', 'Licensing', 'If I buy a song with web advertising use which license is for using 3 years, how could I manage to re-buy it every 3 years? I mean, people will have a lot of issue like this, they really re-buy it every 3 year? Coworkers changes all the time, and materials using in many different pages, videos..., that\'s so inconvenient! \r\n', '2021-01-27 08:59:42'),
(371, 'Reallusion', 'smbuy@reallusion.com', 'Licensing', 'We tried to get the license of a song and saw the Paypal page showed that we paid successfully(and the payment has been debited from our Paypal account), but we haven\'t got the license via mail, could you help to find out what\'s wrong with our operating process? Or where could we find the download link of the song file and the license?\r\nThanks!\r\nThe song: https://www.greatomusic.com/music-search-result.php?search=1608205791-2133301698\r\nOur Paypal account mail: paypal@reallusion.com', '2021-02-02 07:21:18'),
(426, 'Colby', 'arqitechmusic@gmail.com', 'Licensing', 'HI! I currently have a new original song on the spotify release radar, and planning to promote with a couple influencers soon. For future remixes I\'d like to know if there\'s a way you\'d be open to working with me on a spotify royalty split instead of the 3 year - world licensing fees for a capellas? If that\'s possible. ', '2021-04-27 16:19:10'),
(427, 'Davol', 'davolofficial@gmail.com', 'Sample Clearance', 'Hey, i just bought Dj tools performance vol.7.\r\nThese acapellas are free? We can use for a song ? are free copyright?\r\nWaiting for your reply.', '2021-04-27 20:37:53'),
(428, 'Jorge Barrales', 'jorge.barrales97@outlook.com', 'Sample Clearance', 'Hi there i recently bought a track off beatport titled \"Around the World (Acapella Version) Original Mix\" and ive created a remix. can i have clearance to use the acapella so i can get it released on a label. \r\n\r\nJorge', '2021-05-04 11:45:30'),
(444, 'Chris Love', 'ddrpro8@gmail.com', 'Questions', 'Hello, I have just purchased \"Pull Up to the Bumper (Accapella Version)\" in the style of Patra from Traxsource and I wanted to reach out to see if you could provide the lyric sheet to it? Thank you very much.', '2021-10-22 17:43:17'),
(476, 'Mathias Kieslich', 'management@ziggyx.com', 'Licensing', 'Hello,\r\nwe would like to license the acapella vocals of \'Sweet Caroline\'.(https://www.greatomusic.com/license.php?file=sweet-caroline-acapella-version&cart_item=0).\r\n- Worldwide\r\nUnfortunately, we had to find out that you offer the license for $500 and only for three years. That seems exaggerated to us for non-exclusive vocals.\r\nwe could hire a singer who sounds similar cost less more for lifetime and exclusive. Would you change anything in your offer? \r\n\r\nKind regards\r\nMathias', '2022-01-25 16:08:25'),
(488, 'Thomas Fenske', 't.fenske72@web.de', 'Licensing', 'Hi there,\r\nI would like to license the acapella version of \"Sweet Caroline\" for a music project. However, a three-year restriction makes little sense. Is it possible that we can agree on another deal?\r\n\r\nKind regards\r\nThomas ', '2022-02-24 16:40:28'),
(502, 'Dumitru Mereacre', 'mereacre_dima@mail.ru', 'Licensing', 'Hi there. I have bought an acapella from your pack calling Heaven ( original song is Dj Sammy-Heaven). Could i make a remix and upload it on my channel because to buy a license for a cover is very expensive and i am not making money on music.thx', '2022-03-12 18:56:49'),
(506, 'Henri Grimm', 'tropicalspaceman@gmail.com', 'Questions', 'Hey guys, \r\nI\'d like to use your version of \"Here comes the hot stepper\" acapella in a remix. Let me know how I would go about this. \r\nThank you\r\nHenri', '2022-03-15 23:45:49'),
(551, 'Callum', 'callum@makeus.care', 'Licensing', 'Hi there\r\n\r\nI\'m looking to use one of your tracks for an advertising campaign in the UK. Does your licence cover the UK? I\'m guessing if I select the \"world\" territory then I should be fine.\r\n\r\nAlso is there anything I should be aware of in regards to the original publishers as this is a close resemblance to the original?\r\n\r\nU Can\'t Touch This (Instrumental Version) | In the style of MC Hammer | Instrumental Version\r\nhttps://www.greatomusic.com/music-search-result.php?search=1649926586-847260409\r\n\r\nMany thanks\r\n\r\nCallum', '2022-04-14 09:31:20'),
(564, 'john newbold', 'john.newboldvii@gmail.com', 'Sample Clearance', 'Hi, I am looking for a source of acapellas to use in dance music so I would typically just take three of four words or a couple of bars from an acapella to use as a \"hook\". When the tracks are finished I want to release them on digital and possibly vinyl. Vinyl release would be uk only, I guess the nature of digital means that it would be global. What kind of license would I need? Thanks  ', '2022-04-22 09:16:21'),
(566, 'Roberto - Lupo', 'lupodimaredj@gmail.com', 'Licensing', 'Dear Great \"O\" Music,\r\nPlease I see the acapella Lady Marmalade, it will be nice for an our tech house remix project, but the price for the licencing is too much for us, in Italy the price is different for anything like New York, please can we have a discount for that?Please! ', '2022-04-22 16:50:39'),
(606, 'Staci Pohl', 'staci.pohl@zentertainmentla.com', 'Questions', 'Hello.\r\nI have a quarterly payment and statement here that was returned.  We have an address on Blakeslee Ave, NoHo on file. Can you please email me your new address where I should forward this and all future payments/notices to?\r\nThank you.\r\nStaci Pohl', '2022-06-07 21:51:07'),
(608, 'Royce Groome', 'royceschoice@gmail.com', 'Licensing', 'Hi team, I recently purchased a sounds recording license and after downloading the file I am noticing that the audio file is a little bit too processed and the vocal tuning tools that I am using are not having the desired effect. \r\nIs there any possibility of you sending me the original raw recording file before any processing or tuning ? \r\nPlease let me know if this is a possibility. \r\nBest regards\r\nRoyce', '2022-09-22 12:58:43'),
(609, 'Mark Robinson', 'info@asylumtalent.com', 'Sample Clearance', 'Hi There,\r\n\r\nOne of my artists has used parts of the accapella \'The Love I Lost\' after purchasing it at Beatport \r\nhttps://www.beatport.com/track/the-love-i-lost-acapella-version/6839102 \r\n\r\nWe are keen to arrange sample clearance with you in order to be able to release the project commercially.\r\n\r\nCan you please advise on your clearance process? \r\n\r\nMany thanks\r\n\r\nMark Robinson\r\nAsylum Talent ', '2022-10-17 10:55:15'),
(623, 'Mark Robinson', 'info@asylumtalent.com', 'Sample Clearance', 'Hi There,\r\n\r\nI wrote to you via here about a week ago regarding clearance on an accapella of \'The Love I Lost\' one of my artists Billy Da Kid has used on a track we are keen to clear for official release.\r\n\r\nBilly Da Kid - The Love I Lost\r\nhttps://on.soundcloud.com/rTVgf  \r\n\r\nCould you let me know if it is possible to clear usage of this? ', '2022-11-02 10:03:30'),
(637, 'Mark Robinson', 'info@asylumtalent.com', 'Sample Clearance', 'Hi There,\r\n\r\nIve sent a few messages regarding obtaining clearance to use your version of \'The Love I Lost\' for a track we have coming from Billy Da Kid. \r\nhttps://on.soundcloud.com/875in \r\nWe have a deal with TMRW music in Australia and are keen to move forward.\r\n\r\nPlease get back to me \r\n\r\nThanks \r\n\r\nMark Robinson\r\nAsylum Talent\r\ninfo@asylumtalent.com\r\n+44 7958 117 504', '2022-11-21 12:22:32'),
(639, 'Stuart', 'flowstarsolutions@gmail.com', 'Sample Clearance', 'Hello, is your company still active? Been trying to get in contact regarding clearing a sample and have had no response.\r\nWould be great to hear from you asap.\r\nKind regards,\r\nStuart ', '2022-11-29 20:13:00'),
(640, 'Stuart', 'flowstarsolutions@gmail.com', 'Sample Clearance', 'Hello, is your company still active? Been trying to get in contact regarding clearing a sample and have had no response.\r\nWould be great to hear from you asap.\r\nKind regards,\r\nStuart ', '2022-12-01 22:46:57'),
(645, 'James Keay', 'jameskeay@btinternet.com', 'Sample Clearance', 'Hey,\r\nI have created a remix using the \"Like a Prayer (Acapella Mix) [Remix Tool]\" purchased on beatport. Just wanted to see what your policy was regarding releasing it onto SoundCloud, Apple Music, Spotify?\r\nThanks for your help,\r\nJames', '2023-02-09 18:57:56'),
(671, 'Jw', 'jw.jwebster@gmail.com', 'Licensing', 'Hi\r\nIf your master sound recording is used for a music licence can the file be edited and smaller samples used or must the entire master length be used as a cover license?\r\nFor example, what if I want to edit your master and used just a few seconds in my song and edit vocals etc', '2023-04-16 01:59:31'),
(675, 'Cherise Higgins', 'cherise.higgins@avsquad.com', 'Licensing', 'Email or contact for licensing request.', '2023-07-11 20:51:55');
