INSERT INTO `faqs` (`id`, `question`, `answer`, `created_at`, `updated_at`) VALUES
(1, 'What is a sound-alike recording?', '<p>A sound-alike recording is a cover version in the style of a popular title. The sound-alike cover versions offered are not the original artists.</p>', '2023-08-21 14:12:45', '2023-08-21 08:42:45'),
(2, 'What format are the sound-alike cover versions?', '<p>The sound-alike cover versions were recorded at a professional recording studio. The file formats are .wav and .mp3 format (44.1kHz, 16-bit).</p>', '2023-08-21 14:13:19', '2023-08-21 08:43:19'),
(4, 'Do you offer stems of the sound-alike cover versions?', '<p>No stems are offered. The sound-alike cover versions are only in a stereo format.</p>', '2023-08-21 14:14:23', '2023-08-21 08:44:23'),
(5, 'Are the sound-alike cover versions royalty free?', '<p>No, the sound-alike cover versions offered are not royalty free. You do not have the right to use the sound-alike cover versions unless you obtain a License from us. You still will be required to obtain a license from the original publisher for the musical composition through The Harry Fox Agency (www.harryfox.com).</p>', '2023-08-21 14:14:54', '2023-08-21 08:44:54'),
(6, 'When I purchase a license from Great \"O\" Music what exactly am I paying for?', '<p>When you buy a license from Great &quot;O&quot; Music, the price is for a license to use the sound-alike cover version in your music project. Please keep your invoice as proof of purchase and your agreement which stipulates the specific license.</p>', '2023-08-21 08:45:26', '2023-08-21 08:45:26'),
(7, 'When I purchase a license from Great \"O\" Music what exactly am I paying for?', '<p>When you buy a license from Great &quot;O&quot; Music, the price is for a license to use the sound-alike cover version in your music project. Please keep your invoice as proof of purchase and your agreement which stipulates the specific license.</p>', '2023-08-21 08:46:00', '2023-08-21 08:46:00'),
(9, 'May I resell the sound-alike cover version?', '<p>No, reselling of the sound-alike cover version as a &quot;stand alone version&quot; or without a musical accompaniment is strictly prohibited. However, you may sell your new music production that incorporates the sound-alike cover version, such as a cover acapella with our Sound Recording License agreement.</p>', '2023-08-21 08:47:14', '2023-08-21 08:47:14'),
(10, 'May I resell the sound-alike cover version?', '<p>No, reselling of the sound-alike cover version as a &quot;stand alone version&quot; or without a musical accompaniment is strictly prohibited. However, you may sell your new music production that incorporates the sound-alike cover version, such as a cover acapella with our Sound Recording License agreement.</p>', '2023-08-21 08:47:54', '2023-08-21 08:47:54'),
(11, 'Do I have to pay Great \"O\" Music any royalties from my sales?', '<p>No, you keep the revenue generated from sales under the terms of the specific license agreement.</p>', '2023-08-21 08:48:12', '2023-08-21 08:48:12'),
(12, 'What happens once my license expires?', '<p>Once your license expires, you have the option to purchase a new license, otherwise you are required to remove our music title as per the terms of the specific license agreement.</p>', '2023-08-21 08:48:26', '2023-08-21 08:48:26');
