(1, 'Corporate Presentation Sync License', '<h1 style=\'text-align:center\'>$license</h1>\r\n<br />\r\n<div><div style=\'text-align:center\'>This agreement is for our master/sound \r\nrecording only, you still will be required to obtain a license from the \r\noriginal publisher or copyright owner through harryfox.com<br /></div>\r\n<br />\r\n<table>\r\n	<tbody><tr>\r\n		<td style=\'text-align:left\' width=\'120px\'>To : </td>\r\n		<td style=\'text-align:left\' width=\'400px\'>$name</td>\r\n	</tr>\r\n	<tr>\r\n		<td style=\'text-align:left\' width=\'120px\'>Address : </td>\r\n		<td style=\'text-align:left\' width=\'400px\'>$address</td>\r\n	</tr>\r\n	<tr>\r\n		<td style=\'text-align:left\' width=\'120px\'>Date : </td>\r\n		<td style=\'text-align:left\' width=\'400px\'>$date</td>\r\n	</tr>\r\n	<tr>\r\n		<td style=\'text-align:left\' width=\'120px\'>Re : </td>\r\n		<td style=\'text-align:left\' id=\'id1\' width=\'400px\'>Non-Exclusive License: \'$title\',  $artist </td>\r\n	</tr>\r\n</tbody></table>\r\n<br />\r\n<hr><br />\r\n<p style=\'text-align:justify\'>On behalf of Great \'O\' Music, we are pleased to make you the following offer to license \r\n\r\nour Title as set forth below:</p><br />\r\n<br />\r\n<table>\r\n	<tbody><tr>\r\n		<td style=\'text-align:left\' width=\'120px\'>Licensee :</td>\r\n		<td style=\'text-align:left\' width=\'400px\'>$name, $company</td>\r\n	</tr>\r\n	<tr>\r\n		<td style=\'text-align:left\' width=\'120px\'>Project :</td>\r\n		<td style=\'text-align:left\' width=\'400px\'>$project</td>\r\n	</tr>\r\n	<tr>\r\n		<td style=\'text-align:left\' width=\'120px\'>Title :</td>\r\n		<td style=\'text-align:left\' width=\'400px\'>\'$title\'</td>\r\n	</tr>\r\n	<tr>\r\n		<td style=\'text-align:left\' width=\'120px\'>Rights :</td>\r\n		<td style=\'text-align:left\' id=\'id1\' width=\'400px\'>Sound Recording Only (Cover Version) solely in \r\n\r\nsync with visual images. \r\nNon-Exclusive. No third party licensing granted.</td>\r\n	</tr>\r\n	<tr>\r\n		<td styl