INSERT INTO `licensing` (`id`, `text`, `headerimg`) VALUES
(1, '<p>In order to license any Great &quot;O&quot; Music masters then just follow these easy steps:</p>\r\n\r\n<p>(1) Find a music title by searching the Great &quot;O&quot; Music <a href=\"https://dev2.greatomusic.com/music-search\" target=\"_blank\">catalog</a>.<br />\r\n(2) Once you select the music title then click on the Cart button.<br />\r\n(3) You then enter the License Request where you select the type of License you&#39;re looking for.<br />\r\n(4) Complete the License Request and then approve the license terms.<br />\r\n(5) Checkout is made easy using Stripe with all major credit cards.<br />\r\n(6) Check your email address for confirmation of the license details.<br />\r\n(7) Your invoice, license and music download will be available in your user account.</p>\r\n\r\n<p>We have many licenses available, but if you don&#39;t see the license you desire then simply <a href=\"https://dev2.greatomusic.com/contact\" target=\"_blank\">contact</a> us and your license request will be reviewed in a timely manner.</p>', 'licensing.jpg');
