ffective upon the posting thereof. By using this Site, you agree to accept all changes to our Terms, whether or not you have reviewed them.</p>\r\n\r\n<p>4. AGE AND RESIDENCY REQUIREMENTS</p>\r\n\r\n<p>This Site is offered and made available only to users eighteen (18) years of age or older. If you are not yet eighteen (18) years of age and/or do not meet any other eligibility requirements, please discontinue using this Site immediately. By using or attempting to use this Site, you certify that you are at least eighteen (18) years of age and meet any other eligibility and residency requirements of this Site.</p>\r\n\r\n<p>5. PASSWORDS AND ACCOUNT SECURITY</p>\r\n\r\n<p>In consideration of your use of this Site, you agree to: (a) provide accurate, current and complete information about you as may be prompted by any registration forms on this Site (&quot;Registration Data&quot;); (b) maintain and promptly update the Registration Data, and any other information you provide to Company, to keep it accurate, current and complete; (c) maintain the security of your password and identification; (d) notify Company immediately of any unauthorized use of your account or other breach of security; (e) accept all responsibility for any and all activities that occur under your account; and (f) accept all risks of unauthorized access to the Registration Data and any other information you provide to Company. You are responsible for safeguarding the password that you use to access this Site and for any activities or actions under your password. We encourage you to use &quot;strong&quot; passwords (passwords that use a combination of upper and lower case letters, number and symbols) with your account. Company will not be liable for any loss or damage arising from your failure to comply with these requirements.</p>\r\n\r\n<p>6. DISCLAIMER REGARDING LINKS</p>\r\n\r\n<p>This Site is a resource for information on matters that might be of interest to current or potential clients. As a resul