and is provided solely for your personal, non-commercial use, unless otherwise agreed to in a separate written agreement by Company and you. You have no right to use Company&#39;s name or any of Company&#39;s trademarks, logos, domain names, or other distinctive brand features. Any other use of the Content and software on this Site, including the reproduction, modification, distribution, transmission, republication, display or performance of such Content and software, without proper license agreements with Company, is strictly prohibited.</p>\r\n\r\n<p>10. TITLE LICENSING</p>\r\n\r\n<p>A. From time to time, this Site may provide you the opportunity to preview a performance of the Title, which will allow you to stream an MP3 file of the specific Titles of Company (each a &quot;Title&quot; or collectively &quot;Titles&quot;), for evaluation or audition purposes only. In this case, Company grants you a non-transferable, non-exclusive license to stream and use the Title solely for evaluation or audition purposes, or for demonstration to your clients, but only when used in a non-commercial manner.</p>\r\n\r\n<p>B. In the event you wish to use a Title or Titles in a commercial manner, you shall be required to agree to the usage terms for the Title and cost of such use in a separate written license agreement with Company (the &quot;License&quot;) that limits the use of the Title to those exact terms (e.g., excludes any license in the underlying musical composition embodied in the Title). Upon agreement to the terms of the License, you will then be provided the opportunity to download the Title from your user account with this Site. A PDF file of the invoice and License will be sent to you and will also be available in your user account. The provisions of the License will control your use of the Title and will override any conflicting provisions in these Terms with respect to your use of the Title.</p>\r\n\r\n<p>C. Except for those uses described above, no other rights for any other type of use are permitted unless the rates and rights for any other such type of use is negotiated and otherwise agreed to in advance. All Titles and all rights not expressly granted in writing remain the exclusive property of Company.</p>\r\n\r\n<p>11. PAYMENT</p>\r\n\r\n<p>The fee requested for any transaction may be paid through PayPal (www.paypal.com) and/or Credit Cards. The cost for the services offered by PayPal or by Credit Cards will be charged totally to you. Company will not be responsible regarding the use of the service offered by third parties (e.g. PayPal and Credit Cards). The Credit Card payments over the Site are combined with the services of a secure Payment Processor or Gateway. The Payment Gateway provider assumes the risk and responsibility of securely passing the payment account information from the web portal to the Merchant Bank provider. The services offered by Company are not to be used by any persons under the age of eighteen (18) in absence of the supervision and consent of a parent or legal guardian.&nbsp;All sales are final. No returns or exchanges.</p>\r\n\r\n<p>12. RULES OF CONDUCT</p>\r\n\r\n<p>In connection with your use of this Site, you agree to abide by all applicable local, state, national and international laws and regulations and not, nor allow or facilitate a third party to, violate or infringe any rights (including, without limitation, copyrights, rights of publicity or privacy and trademarks) of others or our policies or the operational or security mechanisms of this Site. Your violation of any of the below prohibitions automatically terminates your right to use this Site and you are on notice that we intend to pursue our legal remedies for any violation.</p>\r\n\r\n<p>13. CONTENT USE PROHIBITIONS</p>\r\n\r\n<p>Any unauthorized use of the Content included on this Site is prohibited by law and may result in civil and criminal penalties. Unless permitted in the License, you may not:</p>\r\n\r\n<p>A. Download, modif