d &quot;as is&quot; and company excludes to the fullest extent permitted by applicable law any warranty, express or implied, including, without limitation, any implied warranties of title, non-infringement, merchantability, satisfactory quality or fitness for a particular purpose. Furthermore, content types (including, but not limited to, genres, sub-genres, categories and sub-categories) and descriptions are provided for convenience, and you acknowledge and agree that company does not guarantee their accuracy.</p>\r\n\r\n<p>B. The functions embodied on, or in the materials of, this Site are not warranted to be uninterrupted or without error. You assume the entire cost of all necessary servicing, repair or correction due to your use of this Site. Company makes no warranty as to the accuracy, completeness or reliability of any content, information, products, services or materials made available on or through this Site.</p>\r\n\r\n<p>C. You expressly agree that your use of this Site is at your sole risk. Company neither endorses nor is responsible for the accuracy, completeness or reliability of any opinion, advice, statement, information or other content made available on or through this Site, nor will it be liable under any circumstances for any loss or damage caused by your reliance on any content, information, products, services or materials obtained on or through this Site.</p>\r\n\r\n<p>D. Except as specifically stated in these Terms, any Licenses or elsewhere on this Site, or as otherwise required by applicable law, neither Company nor its directors, employees, licensors, content providers, affiliates or other representatives will be liable for damages of any kind (including, without limitation, lost profits, direct, indirect, compensatory, consequential, exemplary, special, incidental or punitive damages) arising out of your use of, your inability to use, or the performance of this Site or the Content, whether or not we have been advised of the possibility of 