any, either specific or general, in jurisdictions other than New York, New York. These Terms shall be governed by the internal substantive laws of the State of New York, without respect to its conflict of laws principles. Any claim or dispute between you and Company that arises in whole or in part from the Site shall be decided exclusively by a court of competent jurisdiction located in the city, county and State of New York. These Terms, together with any other legal notices published by Company or the Service, shall constitute the entire agreement between you and Company concerning the Site. If any provision of hereof is deemed invalid by a court of competent jurisdiction, the invalidity of such provision shall not affect the validity of the remaining provisions hereof, which shall remain in full force and effect. No waiver of any term hereof shall be deemed a further or continuing waiver of such term or any other term, and Company&#39;s failure to assert any right or provision hereunder shall not constitute a waiver of such right or provision. Company reserves the right to amend these Terms at any time and without notice, and it is your responsibility to review for any changes. Your use of the Site following any amendment of these Terms will signify your assent to and acceptance of its revised terms. YOU AND COMPANY AGREE THAT ANY CAUSE OF ACTION ARISING OUT OF OR RELATED TO THE TERMS OR THE WEBSITE MUST COMMENCE WITHIN ONE (1) YEAR AFTER THE CAUSE OF ACTION ACCRUES. OTHERWISE, SUCH CAUSE OF ACTION IS PERMANENTLY BARRED.</p>\r\n\r\n<p>B. Changes to this Site</p>\r\n\r\n<p>i. Company retains title and ownership of this Site and may make changes or improvements to the Content, information, services, products or other materials on this Site at any time without notice.</p>\r\n\r\n<p>C. Indemnification</p>\r\n\r\n<p>i. You agree to defend, indemnify and hold harmless Company, its subsidiaries, affiliates, licensors, employees, agents, third party information providers